(8, 23, 0, 'paypal', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class paypal\r\n{\r\n    function paypal()\r\n    {\r\n    }\r\n    function __construct()\r\n    {\r\n        $this->paypal();\r\n    }\r\n    function get_code($order, $payment,$db)\r\n    {\r\n\r\n	$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n		eval($payment[''Payment''][''config'']);\r\n		$data_pay_account   = $payment_arr[''data_pay_account''][''value''];\r\n		if(isset($db->configs[''mlti_currency_module'']) && $db->configs[''mlti_currency_module''] == 1 && isset($order[''currency_code''])){\r\n			$currency_code      = $order[''currency_code''];\r\n		}else{\r\n			$currency_code      = $payment_arr[''currency_code''][''value''];\r\n		}\r\n        $data_order_id      = $order[''log_id''];\r\n		$no_note 	   		= $db->configs[''shop_name'']."-".$order[''log_id''];\r\n        $data_amount        = $order[''total''];\r\n        $data_return_url    = "http://".$host.$db->webroot."responds/index/paypal";\r\n        $data_notify_url    = "http://".$host.$db->webroot."responds/index/paypal";\r\n        $cancel_return      = "http://".$host.$db->webroot."";\r\n\r\n        $def_url  = ''<br /><form style="text-align:center;" action="https://www.paypal.com/cgi-bin/webscr" method="post" target="_blank">'' .   // 不能省略\r\n            "<p class=''back_home''>".\r\n	    "<input type=''hidden'' name=''cmd'' value=''_xclick''>" .                             // 不能省略\r\n            "<input type=''hidden'' name=''business'' value=''$data_pay_account''>" .                 // 贝宝帐号\r\n            "<input type=''hidden'' name=''item_name'' value=''$no_note''>" .                 // payment for\r\n            "<input type=''hidden'' name=''amount'' value=''$data_amount''>" .                        // 订单金额\r\n            "<input type=''hidden'' name=''currency_code'' value=''$currency_code''>" .            // 货币\r\n            "<input type=''hidden'' name=''return'' value=''$data_return_url''>" .                    // 付款后页面\r\n            "<input type=''hidden'' name=''invoice'' value=''$data_order_id''>" .                      // 订单号\r\n            "<input type=''hidden'' name=''charset'' value=''utf-8''>" .                              // 字符集\r\n            "<input type=''hidden'' name=''no_shipping'' value=''1''>" .                              // 不要求客户提供收货地址\r\n            "<input type=''hidden'' name=''no_note'' value=''$no_note''>" .                                  // 付款说明\r\n            "<input type=''hidden'' name=''notify_url'' value=''$data_notify_url''>" .\r\n            "<input type=''hidden'' name=''rm'' value=''2''>" .\r\n            "<input type=''hidden'' name=''cancel_return'' value=''$cancel_return''>" .\r\n            "<input type=''submit'' value=''使用 paypal 支付''>" .                      // 按钮\r\n            "</p>".\r\n		"</form><br />";\r\n\r\n        return $def_url;\r\n    }\r\n    function respond($db)\r\n    {\r\n        \r\n        \r\n        //$payment        = get_payment(''paypal'');\r\n        //$merchant_id    = $payment[''paypal_account''];               ///获取商户编号\r\n        $payment = $db->Payment->findbycode(''paypal'');\r\n		eval($payment[''Payment''][''config'']);\r\n		$merchant_id   = $payment_arr[''data_pay_account''][''value''];\r\n		$currency_code      = $payment_arr[''currency_code''][''value''];        \r\n		// read the post from PayPal system and add ''cmd''\r\n        $req = ''cmd=_notify-validate'';\r\n        foreach ($_POST as $key => $value)\r\n        {\r\n            $value = urlencode(stripslashes($value));\r\n            $req .= "&$key=$value";\r\n        }\r\n\r\n        // post back to PayPal system to validate\r\n        $header = "POST /cgi-bin/webscr HTTP/1.0\\r\\n";\r\n        $header .= "Content-Type: application/x-www-form-urlencoded\\r\\n";\r\n        $header .= "Content-Length: " . strlen($req) ."\\r\\n\\r\\n";\r\n        $fp = fsockopen (''www.paypal.com'', 80, $errno, $errstr, 30);\r\n\r\n        // assign posted variables to local variables\r\n        $item_name = $_POST[''item_name''];\r\n        $item_number = $_POST[''item_number''];\r\n        $payment_status = $_POST[''payment_status''];\r\n        $payment_amount = $_POST[''mc_gross''];\r\n        $payment_currency = $_POST[''mc_currency''];\r\n        $txn_id = $_POST[''txn_id''];\r\n        $receiver_email = $_POST[''receiver_email''];\r\n        $payer_email = $_POST[''payer_email''];\r\n        $order_sn = $_POST[''invoice''];\r\n        $memo = !empty($_POST[''memo'']) ? $_POST[''memo''] : '''';\r\n        $action_note = $txn_id . ''（paypal 交易号）'' . $memo;\r\n\r\n        if (!$fp)\r\n        {\r\n            fclose($fp);\r\n\r\n            return false;\r\n        }\r\n        else\r\n        {\r\n            fputs($fp, $header . $req);\r\n            while (!feof($fp))\r\n            {\r\n                $res = fgets($fp, 1024);\r\n                if (strcmp($res, ''VERIFIED'') == 0)\r\n                {\r\n                    // check the payment_status is Completed\r\n                    if ($payment_status != ''Completed'' && $payment_status != ''Pending'')\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    // check that receiver_email is your Primary PayPal email\r\n                    if ($receiver_email != $merchant_id)\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    \r\n        			$payment_log = $db->PaymentApiLog->findbyid($order_sn);\r\n        					//检查是否已成功支付\r\n					if($payment_log[''PaymentApiLog''][''is_paid''] == "1"){\r\n			                fclose($fp);\r\n			 			return false;\r\n			 		}\r\n			        $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n                    // check that payment_amount/payment_currency are correct\r\n					if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n					$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n				        if ($payment_amount != $account[''UserAccount''][''amount''])\r\n				        {\r\n			                fclose($fp);\r\n				            return false;\r\n				        }\r\n			        }else{\r\n	        	        if ($order_total[''Order''][''total''] != $payment_amount)\r\n	                    {\r\n	                        fclose($fp);\r\n\r\n	                        return false;\r\n	                    }\r\n        			}\r\n					if(isset($db->configs[''mlti_currency_module'']) && $db->configs[''mlti_currency_module''] == 1){\r\n						$currency_code      = $order_total[''Order''][''currency_code''];\r\n					}\r\n					\r\n                    if ($currency_code != $payment_currency)\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    \r\n	  \r\n				    if($payment_log[''PaymentApiLog''][''type''] < 1)\r\n				    {                    // process payment\r\n			            /* 改变订单状态 */\r\n						$db->update_order($payment_log,$order_total);        			           \r\n	                    fclose($fp);\r\n	                    return true;\r\n                    }else{\r\n						/* 充值成功*/\r\n						$db->update_balance($payment_log,$order_total);       \r\n						fclose($fp);\r\n				      	return true;\r\n                    }\r\n                }\r\n                elseif (strcmp($res, ''INVALID'') == 0)\r\n                {\r\n                    // log for manual investigation\r\n                    fclose($fp);\r\n\r\n                    return false;\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n', '', '2008-01-01 00:00:00', '2015-03-25 10:23:50'),
(13, 23, 0, 'cncard', '0', 0, NULL, '0', NULL, '1', 0, '0', '1', '1', 'class cncard\r\n{\r\n    function cncard()\r\n    {\r\n    }\r\n    function __construct()\r\n    {\r\n        $this->cncard();\r\n    }\r\n    function get_code($order, $payment,$db)\r\n    {\r\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n        eval($payment[''Payment''][''config'']);    \r\n		$c_mid = $payment_arr[''c_mid''][''value''];\r\n		$c_pass = $payment_arr[''c_pass''][''value''];\r\n		$c_memo1 = $payment_arr[''c_memo1''][''value''];\r\n		$c_moneytype = $payment_arr[''c_moneytype''][''value'']; //支付币种，0为人民币\r\n		$c_language = $payment_arr[''c_language''][''value''];\r\n		$c_paygate = $payment_arr[''c_paygate''][''value''];\r\n		    	\r\n        $c_mid      = trim($c_mid);  		//商户编号，在申请商户成功后即可获得，可以在申请商户成功的邮件中获取该编号\r\n        $c_order    = $order[''log_id''];       			//商户网站依照订单号规则生成的订单号，不能重复\r\n        $c_name     = "";                       		//商户订单中的收货人姓名\r\n        $c_address  = "";                       		//商户订单中的收货人地址\r\n        $c_tel      = "";                       		//商户订单中的收货人电话\r\n        $c_post     = "";                       		//商户订单中的收货人邮编\r\n        $c_email    = "";                       		//商户订单中的收货人Email\r\n        $c_orderamount = $order[''total''];        		//商户订单总金额\r\n        $c_ymd      = $this->local_date(''Ymd'',$db,$order[''created'']);		\r\n        //$c_ymd      = substr($order[''order_sn''], 0, 8); //商户订单的产生日期，格式为"yyyymmdd"，如20050102\r\n        $c_retflag  = "1";                              //商户订单支付成功后是否需要返回商户指定的文件，0：不用返回 1：需要返回\r\n        $c_paygate  = empty($payment[''c_paygate'']) ? '''' : trim($payment[''c_paygate'']); //如果在商户网站选择银行则设置该值，具体值可参见《云网支付@网技术接口手册》附录一；如果来云网支付@网选择银行此项为空值。\r\n        $c_returl   = "http://".$host.$db->webroot."/responds/index/cncard"; //如果c_retflag为1时，该地址代表商户接收云网支付结果通知的页面，请提交完整文件名(对应范例文件：GetPayNotify.php)\r\n        $c_memo1    = abs(crc32(trim($c_memo1)));     	//商户需要在支付结果通知中转发的商户参数一\r\n        if (empty($order[''log_id'']))\r\n        {\r\n            $c_memo2    = "voucher";                      //商户需要在支付结果通知中转发的商户参数二\r\n        }\r\n        else\r\n        {\r\n            $c_memo2    = '''';\r\n        }\r\n        $c_pass     = trim($c_pass);      //支付密钥，请登录商户管理后台，在帐户信息-基本信息-安全信息中的支付密钥项\r\n        $notifytype = "0";                           //0普通通知方式/1服务器通知方式，空值为普通通知方式\r\n        $c_language = trim($c_language);  //对启用了国际卡支付时，可使用该值定义消费者在银行支付时的页面语种，值为：0银行页面显示为中文/1银行页面显示为英文\r\n\r\n        $srcStr = $c_mid . $c_order . $c_orderamount . $c_ymd . $c_moneytype . $c_retflag . $c_returl . $c_paygate . $c_memo1 . $c_memo2 . $notifytype . $c_language . $c_pass;      //说明：如果您想指定支付方式(c_paygate)的值时，需要先让用户选择支付方式，然后再根据用户选择的结果在这里进行MD5加密，也就是说，此时，本页面应该拆分为两个页面，分为两个步骤完成。\r\n\r\n        //--对订单信息进行MD5加密\r\n        //商户对订单信息进行MD5签名后的字符串\r\n        $c_signstr  = md5($srcStr);\r\n\r\n         $def_url = ''<form name="payForm1" action="https://www.cncard.net/purchase/getorder.asp" method="POST" target="_blank">''.\r\n         	             "<p class=''back_home''>".\r\n                    "<input type=\\"hidden\\" name=\\"c_mid\\" value=\\"$c_mid\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_order\\" value=\\"$c_order\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_name\\" value=\\"$c_name\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_address\\" value=\\"$c_address\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_tel\\" value=\\"$c_tel\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_post\\" value=\\"$c_post\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_email\\" value=\\"$c_email\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_orderamount\\" value=\\"$c_orderamount\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_ymd\\" value=\\"$c_ymd\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_moneytype\\" value=\\"$c_moneytype\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_retflag\\" value=\\"$c_retflag\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_paygate\\" value=\\"$c_paygate\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_returl\\" value=\\"$c_returl\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_memo1\\" value=\\"$c_memo1\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_memo2\\" value=\\"$c_memo2\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_language\\" value=\\"$c_language\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"notifytype\\" value=\\"$notifytype\\" />".\r\n                    "<input type=\\"hidden\\" name=\\"c_signstr\\" value=\\"$c_signstr\\" />".\r\n                    "<input type=\\"submit\\" name=\\"submit\\" value=\\""."立即使用云网支付"."\\" />".\r\n                         "</p>".\r\n                    "</form><br />";\r\n\r\n        return $def_url;\r\n    }\r\n\r\n    /**\r\n     * 响应操作\r\n     */\r\n\r\n    function respond($db)\r\n    {\r\n        $payment = $db->Payment->findbycode(''cncard'');\r\n        eval($payment[''Payment''][''config'']);\r\n		$c_mid = $payment_arr[''c_mid''][''value''];\r\n		$c_pass = $payment_arr[''c_pass''][''value''];\r\n		//$c_memo1 = $payment_arr[''c_memo1''][''value''];\r\n        \r\n        //--获取云网支付网关向商户发送的支付通知信息(以下简称为通知信息)\r\n        $c_mid          = $_REQUEST[''c_mid''];           //商户编号，在申请商户成功后即可获得，可以在申请商户成功的邮件中获取该编号\r\n        $c_order        = $_REQUEST[''c_order''];         //商户提供的订单号\r\n        $c_orderamount  = $_REQUEST[''c_orderamount''];   //商户提供的订单总金额，以元为单位，小数点后保留两位，如：13.05\r\n        $c_ymd          = $_REQUEST[''c_ymd''];           //商户传输过来的订单产生日期，格式为"yyyymmdd"，如20050102\r\n        $c_transnum     = $_REQUEST[''c_transnum''];      //云网支付网关提供的该笔订单的交易流水号，供日后查询、核对使用；\r\n        $c_succmark     = $_REQUEST[''c_succmark''];      //交易成功标志，Y-成功 N-失败\r\n        $c_moneytype    = $_REQUEST[''c_moneytype''];     //支付币种，0为人民币\r\n        $c_cause        = $_REQUEST[''c_cause''];         //如果订单支付失败，则该值代表失败原因\r\n        $c_memo1        = $_REQUEST[''c_memo1''];         //商户提供的需要在支付结果通知中转发的商户参数一\r\n        $c_memo2        = $_REQUEST[''c_memo2''];         //商户提供的需要在支付结果通知中转发的商户参数二\r\n        $c_signstr      = $_REQUEST[''c_signstr''];       //云网支付网关对已上信息进行MD5加密后的字符串\r\n\r\n        //--校验信息完整性---\r\n        if($c_mid=="" || $c_order=="" || $c_orderamount=="" || $c_ymd=="" || $c_moneytype=="" || $c_transnum=="" || $c_succmark=="" || $c_signstr=="")\r\n        {\r\n            //echo "支付信息有误!";\r\n\r\n            return false;\r\n        }\r\n\r\n        //--将获得的通知信息拼成字符串，作为准备进行MD5加密的源串，需要注意的是，在拼串时，先后顺序不能改变\r\n        //商户的支付密钥，登录商户管理后台(https://www.cncard.net/admin/)，在管理首页可找到该值\r\n        $c_pass = trim($c_pass);\r\n\r\n        $srcStr = $c_mid . $c_order . $c_orderamount . $c_ymd . $c_transnum . $c_succmark . $c_moneytype . $c_memo1 . $c_memo2 . $c_pass;\r\n\r\n        //--对支付通知信息进行MD5加密\r\n        $r_signstr  = md5($srcStr);\r\n\r\n        //--校验商户网站对通知信息的MD5加密的结果和云网支付网关提供的MD5加密结果是否一致\r\n        if($r_signstr!=$c_signstr)\r\n        {\r\n            //echo "签名验证失败";\r\n            return false;\r\n        }\r\n        \r\n        $payment_log = $db->PaymentApiLog->findbyid($c_order);\r\n        \r\n        //验证通过后,将订单sn转换为ID 来操作ec订单表\r\n      /*  if ($c_memo2 == ''voucher'')\r\n        {\r\n            $c_order = get_order_id_by_sn($c_order, "true");\r\n        }\r\n        else\r\n        {\r\n            $c_order = get_order_id_by_sn($c_order);\r\n        }*/\r\n		if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n			$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($c_orderamount != $account[''UserAccount''][''amount''])\r\n	        {\r\n	            return false;\r\n	        }\r\n        }else{\r\n        $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($c_orderamount != $order_total[''Order''][''total''])\r\n	        {\r\n	            return false;\r\n	        }\r\n        }\r\n\r\n\r\n        //--校验商户编号\r\n        $MerchantID= trim($c_mid);   //商户自己的编号\r\n        if($MerchantID!=$c_mid){\r\n            //echo "提交的商户编号有误";\r\n\r\n            return false;\r\n        }\r\n\r\n        if ($c_memo1 != abs(crc32($payment_arr[''c_memo1''][''value''])))\r\n        {\r\n            //echo "个性签名不一致";\r\n            //return false;\r\n        }\r\n\r\n        //--校验返回的支付结果的格式是否正确\r\n        if($c_succmark!="Y" && $c_succmark!="N")\r\n        {\r\n            //echo "参数提交有误";\r\n\r\n            return false;\r\n        }\r\n\r\n        //--根据返回的支付结果，商户进行自己的发货等操作\r\n        if($c_succmark="Y")\r\n        {\r\n            //根据商户自己商务规则，进行发货等系列操作\r\n\r\n		if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n			/* 充值成功*/\r\n			$db->update_balance($payment_log,$order_total);      \r\n			   return true;\r\n		}else {\r\n            /* 改变订单状态 */\r\n			$db->update_order($payment_log,$order_total);       \r\n			 return true;\r\n			}\r\n        }\r\n        else\r\n        {\r\n            //echo $c_cause;\r\n\r\n            return false;\r\n        }\r\n    }\r\n    \r\n    function local_date($format,$db,$time = NULL)\r\n	{\r\n	    $timezone = $db->locale[''default_timezone'']*(-1);\r\n\r\n	    if ($time === NULL)\r\n	    {\r\n	        $time = gmtime();\r\n	    }\r\n	    elseif ($time <= 0)\r\n	    {\r\n	        return '''';\r\n	    }\r\n\r\n	    $time += ($timezone * 3600);\r\n\r\n	    return date($format, $time);\r\n	}    \r\n    \r\n}', '', '2008-01-01 00:00:00', '2015-03-25 10:30:55'),
(3, 23, 0, 'alipay', '0', 0, 'a:5:{s:7:"account";s:13:"sales@ioco.cn";s:3:"key";s:32:"o0nnfuabdwagtqpzqx0ngymopp9dcyt5";s:7:"partner";s:16:"2088502969361766";s:5:"login";s:1:"1";s:3:"foo";s:1:"2";}', '1', '/media/photos/201505/0/16/small/bec60fbff7fe4934d20ddb29d2514f91.png', '0', 0, '1', '1', '1', 'class alipay \n{\n    function alipay()\n    {\n    }\n\n    function __construct()\n    {\n        $this->alipay();\n    }\n    function get_code($order, $payment,$db)\n    {\n	eval($payment[''Payment''][''config'']);\n	$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\n    \n	$alipay_account = $payment_arr[''alipay_account''][''value''];\n	$alipay_partner = $payment_arr[''alipay_partner''][''value''];\n	$alipay_key = $payment_arr[''alipay_key''][''value''];\n	$charset = ''utf-8'';\n	$service = ''create_direct_pay_by_user'';\n	$agent = ''C4335319945672464113'';\n	$parameter = array(\n            ''agent''             => $agent,\n            ''service''           => $service,\n            ''partner''           => $alipay_partner,\n            ''_input_charset''    => $charset,\n            ''notify_url''        => "http://".$host.$db->webroot."/responds/index/alipay",\n            ''return_url''        => "http://".$host.$db->webroot."/responds/index/alipay",\n            /* 业务参数 */\n            ''subject''           => $db->configs[''shop_name'']."-".$order[''log_id''],              //order 型号\n            ''out_trade_no''      => $order[''log_id''],\n            ''price''             => $order[''total''],\n            ''quantity''          => 1,\n            ''payment_type''      => 1,\n            /* 物流参数 */\n            ''logistics_type''    => ''EXPRESS'',\n            ''logistics_fee''     => 0,\n            ''logistics_payment'' => ''BUYER_PAY_AFTER_RECEIVE'',\n            /* 买卖双方信息 */\n            ''seller_email''      => $alipay_account\n        );\n\n	\n        ksort($parameter);\n        reset($parameter);\n		$param = '''';\n        $sign  = '''';\n        foreach ($parameter AS $key => $val)\n        {\n            $param .= "$key=" .urlencode($val). "&";\n            $sign  .= "$key=$val&";\n        }\n		\n        $param = substr($param, 0, -1);\n        $sign  = substr($sign, 0, -1).$alipay_key;\n        $button = "https://www.alipay.com/cooperate/gateway.do?".$param."&sign=".md5($sign)."&sign_type=MD5";\n        return $button;\n    }\n function respond($db)\n    {\n        /*\n        if (!empty($_POST))\n        {\n            foreach($_POST as $key => $data)\n            {\n                $_GET[$key] = $data;\n            }\n        }\n        */\n        $payment = $db->Payment->findbycode(''alipay'');\n        eval($payment[''Payment''][''config'']);    \n		$alipay_account = $payment_arr[''alipay_account''][''value''];\n		$alipay_partner = $payment_arr[''alipay_partner''][''value''];\n		$alipay_key = $payment_arr[''alipay_key''][''value''];\n        $seller_email = rawurldecode($_GET[''seller_email'']);\n        $order_id = str_replace($_GET[''subject''], '''', $_GET[''out_trade_no'']);\n        $order_id = trim($order_id);\n        //取到的是支付的记录id\n        /* 检查支付的金额是否相符 */\n        $payment_log = $db->PaymentApiLog->findbyid($order_id);\n		\n		//检查是否已成功支付\n		if($payment_log[''PaymentApiLog''][''is_paid''] == "1"){\n 			return false;\n 		}\n		\n		if($payment_log[''PaymentApiLog''][''type''] > 0){\n			$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\n	        if ($_GET[''total_fee''] != $account[''UserAccount''][''amount''])\n	        {\n	            return false;\n	        }\n        }else{\n        $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\n	        if ($_GET[''total_fee''] != $order_total[''Order''][''total''])\n	        {\n	            return false;\n	        }\n        }\n\n		$charset = ''utf-8'';\n		$service = ''trade_create_by_buyer'';\n		$agent = ''C4335319945672464113'';\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\n        \n        ksort($_GET);\n        reset($_GET);\n        $arg = "";\n		while (list ($key, $val) = each ($_GET)) {\n			if($key != "sign" && $key != "sign_type" && $key != ''code'' && $key != ''url'')\n			$arg.=$key."=".$val."&";\n		}\n		$prestr = substr($arg,0,count($arg)-2);  //去掉最后一个&号\n		 $sign = $prestr.$alipay_key;\n\n      if (md5($sign) != $_GET[''sign''])\n        {\n            return false;\n        }\n		if($payment_log[''PaymentApiLog''][''type''] > 0){\n			/* 充值成功*/\n			$db->update_balance($payment_log,$account);        			           \n			return true;\n		\n		}else if ($_GET[''trade_status''] == ''WAIT_SELLER_SEND_GOODS'')\n        {\n			$db->update_order($payment_log,$order_total);        			           \n			 return true;\n        }else if ($_GET[''trade_status''] == ''TRADE_FINISHED'')\n        {\n			$db->update_order($payment_log,$order_total);       \n            return true;\n        }\n        else\n        {   \n            return false;\n        }\n    }\n}', '', '2008-01-01 00:00:00', '2015-05-11 10:23:24'),
