(10, 23, 0, 'tenpay', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class tenpay{\r\n    function tenpay()\r\n    {\r\n    }\r\n\r\n    function __construct()\r\n    {\r\n        $this->tenpay();\r\n    }\r\n    \r\n    function get_code($order, $payment,$db)\r\n    {\r\n		eval($payment[''Payment''][''config'']);\r\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n    	\r\n        $cmd_no = ''1'';\r\n        // 订单号 \r\n        $sp_billno = $order[''log_id''];\r\n        // 交易日期 \r\n        $today = date(''Ymd'');\r\n        /* 将商户号+年月日+流水号 */\r\n        $bill_no = str_pad($order[''log_id''], 10, 0, STR_PAD_LEFT);\r\n        // $tenpay_account 商家号\r\n      	$tenpay_account = $payment_arr[''tenpay_account''][''value''];\r\n        $transaction_id = $tenpay_account.$today.$bill_no;\r\n        if(isset($order[''order_code''])){\r\n        	$desc = $order[''order_code''];\r\n        	$attach = '''';			//订单\r\n        }else{\r\n        	$desc =   ''会员充值'';\r\n        	$attach = ''voucher'';					//充值\r\n        }\r\n        \r\n        \r\n        $tenpay_key = $payment_arr[''tenpay_key''][''value''];\r\n        // 银行类型:支持纯网关和财付通 \r\n        $bank_type = ''0'';\r\n        \r\n        // 订单描述\r\n        $desc = $order[''log_id''];\r\n        \r\n        // 返回的路径 \r\n        $return_url = "http://".$host.$db->webroot."responds/index/tenpay";\r\n        // 总金额 \r\n        $total_fee = floatval($order[''total'']) * 100;\r\n        // 货币类型 \r\n        $fee_type = ''1'';\r\n        // 数字签名 \r\n        $sign_text = "cmdno=" . $cmd_no . "&date=" . $today . "&bargainor_id=" . $tenpay_account .\r\n          "&transaction_id=" . $transaction_id . "&sp_billno=" . $sp_billno .\r\n          "&total_fee=" . $total_fee . "&fee_type=" . $fee_type . "&return_url=" . $return_url .\r\n          "&attach=" . $attach . "&key=" . $tenpay_key;\r\n        $sign = strtoupper(md5($sign_text));\r\n\r\n        /* 交易参数 */\r\n        $parameter = array(\r\n            ''cmdno''             => $cmd_no,                     // 业务代码, 财付通支付支付接口填  1\r\n            ''date''              => $today,                      // 商户日期：如20051212\r\n            ''bank_type''         => $bank_type,                  // 银行类型:支持纯网关和财付通\r\n            ''desc''              => $desc,                       // 交易的商品名称\r\n            ''purchaser_id''      => '''',                          // 用户(买方)的财付通帐户,可以为空\r\n            ''bargainor_id''      => $tenpay_account,  			// 商家的财付通商户号\r\n            ''transaction_id''    => $transaction_id,             // 交易号(订单号)，由商户网站产生(建议顺序累加)\r\n            ''sp_billno''         => $sp_billno,                  // 商户系统内部的定单号,最多10位\r\n            ''total_fee''         => $total_fee,                  // 订单金额\r\n            ''fee_type''          => $fee_type,                   // 现金支付币种\r\n            ''return_url''        => $return_url,                 // 接收财付通返回结果的URL\r\n            ''attach''            => $attach,                     // 用户自定义签名\r\n            ''sign''              => $sign                        // MD5签名\r\n        //  ''sys_id''            => ''99887766''                 //sv-cart C账号 不参与签名\r\n        );\r\n\r\n        $button  = ''<br /><form style="text-align:center;" action="https://www.tenpay.com/cgi-bin/v1.0/pay_gate.cgi"  target="_blank" style="margin:0px;padding:0px" >'';\r\n\r\n        foreach ($parameter AS $key=>$val)\r\n        {\r\n            $button  .= "<input type=''hidden'' name=''$key'' value=''$val'' />";\r\n        }\r\n\r\n        $button  .= "<input src=''http://lyceem3.projects.seevia.cn/images/tenpay.gif'' value=''立即使用财付通支付'' type=''image''></form><br />";\r\n\r\n        return $button;\r\n    }\r\n\r\n    /**\r\n     * 响应操作\r\n     */\r\n    function respond($db)\r\n    {\r\n        /*取返回参数*/\r\n        $cmd_no         = $_GET[''cmdno''];\r\n        $pay_result     = $_GET[''pay_result''];\r\n        $pay_info       = $_GET[''pay_info''];\r\n        $bill_date      = $_GET[''date''];\r\n        $bargainor_id   = $_GET[''bargainor_id''];\r\n        $transaction_id = $_GET[''transaction_id''];\r\n        $sp_billno      = $_GET[''sp_billno''];\r\n        $total_fee      = $_GET[''total_fee''];\r\n        $fee_type       = $_GET[''fee_type''];\r\n        $attach         = $_GET[''attach''];\r\n        $sign           = $_GET[''sign''];\r\n\r\n        $payment    = $db->Payment->findbycode(''tenpay'');\r\n		eval($payment[''Payment''][''config'']);\r\n        $tenpay_key = $payment_arr[''tenpay_key''][''value''];\r\n        $payment_log = $db->PaymentApiLog->findbyid($sp_billno);\r\n        //检查是否已成功支付\r\n		if($payment_log[''PaymentApiLog''][''is_paid''] == "1"){\r\n 			return false;\r\n 		}\r\n		/*\r\n        if ($attach == ''voucher'')\r\n        {\r\n            $account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($total_fee != $account[''UserAccount''][''amount''])\r\n	        {\r\n	            return false;\r\n	        }\r\n        }\r\n        else\r\n        {\r\n            $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($total_fee != $order_total[''Order''][''total''])\r\n	        {\r\n	            return false;\r\n	        }\r\n        }*/\r\n		\r\n		if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n            $account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($total_fee != $account[''UserAccount''][''amount''])\r\n	        {\r\n	            return false;\r\n	        }\r\n		}else{\r\n            $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        if ($total_fee != $order_total[''Order''][''total''])\r\n	        {\r\n	            return false;\r\n	        }\r\n		}\r\n		\r\n		\r\n		\r\n        /* 如果pay_result大于0则表示支付失败 */\r\n        if ($pay_result > 0)\r\n        {\r\n            return false;\r\n        }\r\n\r\n        /* 检查支付的金额是否相符 */\r\n     //   if (!check_money($log_id, $total_fee / 100))\r\n     //   {\r\n     //       return false;\r\n      //  }\r\n\r\n        /* 检查数字签名是否正确 */\r\n        $sign_text  = "cmdno=" . $cmd_no . "&pay_result=" . $pay_result .\r\n                          "&date=" . $bill_date . "&transaction_id=" . $transaction_id .\r\n                            "&sp_billno=" . $sp_billno . "&total_fee=" . $total_fee .\r\n                            "&fee_type=" . $fee_type . "&attach=" . $attach .\r\n                            "&key=" . $tenpay_key;\r\n        $sign_md5 = strtoupper(md5($sign_text));\r\n        if ($sign_md5 != $sign)\r\n        {\r\n            return false;\r\n        }\r\n        else\r\n        {\r\n			if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n			$db->update_order($payment_log,$order_total);        			           \r\n\r\n			 return true;			\r\n			}else{\r\n			$db->update_balance($payment_log,$account);        			           \r\n			 return true;			\r\n			}\r\n        }\r\n    }\r\n    \r\n}', '', '2008-01-01 00:00:00', '2015-03-25 10:31:03'),
(7, 23, 0, 'paypalcn', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class paypalcn\r\n{\r\n    function paypalcn()\r\n    {\r\n    }\r\n    function __construct()\r\n    {\r\n        $this->paypalcn();\r\n    }\r\n    function get_code($order, $payment,$db)\r\n    {\r\n\r\n	eval($payment[''Payment''][''config'']);\r\n	$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n	$data_pay_account = $payment_arr[''data_pay_account''][''value''];\r\n\r\n		$currency_code      = "CNY"; // 货币\r\n        $data_order_id      = $order[''log_id''];\r\n		$no_note 	   		= $db->configs[''shop_name'']."-".$order[''log_id''];\r\n        $data_amount        = $order[''total''];\r\n        $data_return_url    = "http://".$host.$db->webroot."/responds/index/paypal";\r\n        $data_notify_url    = "http://".$host.$db->webroot."/responds/index/paypal";\r\n        $cancel_return      = "http://".$host.$db->webroot."/";\r\n\r\n        $def_url  = ''<br /><form style="text-align:center;" action="https://www.paypal.com/cgi-bin/webscr" method="post" target="_blank">'' .   // 不能省略\r\n            "<p class=''back_home''>".\r\n	    "<input type=''hidden'' name=''cmd'' value=''_xclick''>" .                             // 不能省略\r\n            "<input type=''hidden'' name=''business'' value=''$data_pay_account''>" .                 // 贝宝帐号\r\n            "<input type=''hidden'' name=''item_name'' value=''$no_note''>" .                 // payment for\r\n            "<input type=''hidden'' name=''amount'' value=''$data_amount''>" .                        // 订单金额\r\n            "<input type=''hidden'' name=''currency_code'' value=''$currency_code''>" .            // 货币\r\n            "<input type=''hidden'' name=''return'' value=''$data_return_url''>" .                    // 付款后页面\r\n            "<input type=''hidden'' name=''invoice'' value=''$data_order_id''>" .                      // 订单号\r\n            "<input type=''hidden'' name=''charset'' value=''utf-8''>" .                              // 字符集\r\n            "<input type=''hidden'' name=''no_shipping'' value=''1''>" .                              // 不要求客户提供收货地址\r\n            "<input type=''hidden'' name=''no_note'' value=''$no_note''>" .                                  // 付款说明\r\n            "<input type=''hidden'' name=''notify_url'' value=''$data_notify_url''>" .\r\n            "<input type=''hidden'' name=''rm'' value=''2''>" .\r\n            "<input type=''hidden'' name=''cancel_return'' value=''$cancel_return''>" .\r\n            "<input type=''submit'' value=''使用 paypal 支付''>" .                      // 按钮\r\n            "</p>".\r\n		"</form><br />";\r\n\r\n        return $def_url;\r\n    }\r\n    function respond($db)\r\n    {\r\n       // $payment        = get_payment(''paypal'');\r\n        //$merchant_id    = $payment[''paypal_account''];               ///获取商户编号\r\n        $payment = $db->Payment->findbycode(''paypalcn'');\r\n		eval($payment[''Payment''][''config'']);\r\n		$merchant_id   = $payment_arr[''data_pay_account''][''value''];\r\n        // read the post from PayPal system and add ''cmd''\r\n        $req = ''cmd=_notify-validate'';\r\n        foreach ($_POST as $key => $value)\r\n        {\r\n            $value = urlencode(stripslashes($value));\r\n            $req .= "&$key=$value";\r\n        }\r\n\r\n        // post back to PayPal system to validate\r\n        $header = "POST /cgi-bin/webscr HTTP/1.0\\r\\n";\r\n        $header .= "Content-Type: application/x-www-form-urlencoded\\r\\n";\r\n        $header .= "Content-Length: " . strlen($req) ."\\r\\n\\r\\n";\r\n        $fp = fsockopen (''www.paypal.com'', 80, $errno, $errstr, 30);\r\n\r\n        // assign posted variables to local variables\r\n        $item_name = $_POST[''item_name''];\r\n        $item_number = $_POST[''item_number''];\r\n        $payment_status = $_POST[''payment_status''];\r\n        $payment_amount = $_POST[''mc_gross''];\r\n        $payment_currency = $_POST[''mc_currency''];\r\n        $txn_id = $_POST[''txn_id''];\r\n        $receiver_email = $_POST[''receiver_email''];\r\n        $payer_email = $_POST[''payer_email''];\r\n        $order_sn = $_POST[''invoice''];\r\n        $memo = !empty($_POST[''memo'']) ? $_POST[''memo''] : '''';\r\n        $action_note = $txn_id . ''（paypal 交易号）'' . $memo;\r\n\r\n        if (!$fp)\r\n        {\r\n            fclose($fp);\r\n\r\n            return false;\r\n        }\r\n        else\r\n        {\r\n            fputs($fp, $header . $req);\r\n            while (!feof($fp))\r\n            {\r\n                $res = fgets($fp, 1024);\r\n                if (strcmp($res, ''VERIFIED'') == 0)\r\n                {\r\n                    // check the payment_status is Completed\r\n                    if ($payment_status != ''Completed'' && $payment_status != ''Pending'')\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    // check that receiver_email is your Primary PayPal email\r\n                    if ($receiver_email != $merchant_id)\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    \r\n        			$payment_log = $db->PaymentApiLog->findbyid($order_sn);\r\n        			\r\n					//检查是否已成功支付\r\n					if($payment_log[''PaymentApiLog''][''is_paid''] == "1"){\r\n			                fclose($fp);\r\n			 			return false;\r\n			 		}                    \r\n			 		// check that payment_amount/payment_currency are correct\r\n					if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n					$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n				        if ($payment_amount != $account[''UserAccount''][''amount''])\r\n				        {\r\n			                fclose($fp);\r\n				            return false;\r\n				        }\r\n			        }else{\r\n			        $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	        	        if ($order_total[''Order''][''total''] != $payment_amount)\r\n	                    {\r\n	                        fclose($fp);\r\n\r\n	                        return false;\r\n	                    }\r\n        			}\r\n\r\n                    if ("CNY" != $payment_currency)\r\n                    {\r\n                        fclose($fp);\r\n\r\n                        return false;\r\n                    }\r\n                    \r\n	  \r\n				    if($payment_log[''PaymentApiLog''][''type''] < 1)\r\n				    {                    // process payment\r\n			            /* 改变订单状态 */		            \r\n						$db->update_order($payment_log,$order_total);        			           \r\n	                    fclose($fp);\r\n	                    return true;\r\n                    }else{\r\n						/* 充值成功*/\r\n						$db->update_balance($payment_log,$order_total);       \r\n						fclose($fp);\r\n				      	return true;\r\n                    }\r\n                }\r\n                elseif (strcmp($res, ''INVALID'') == 0)\r\n                {\r\n                    // log for manual investigation\r\n                    fclose($fp);\r\n\r\n                    return false;\r\n                }\r\n            }\r\n        }\r\n    }\r\n}	\r\n', '', '2008-01-01 00:00:00', '2015-03-25 10:30:47'),
