(12, 23, 0, 'chinabank', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class chinabank\r\n{\r\n    function chinabank()\r\n    {\r\n    }\r\n    function __construct()\r\n    {\r\n        $this->chinabank();\r\n    }\r\n    function get_code($order, $payment,$db)\r\n    {\r\n		eval($payment[''Payment''][''config'']);\r\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n		$chinabank_account = $payment_arr[''chinabank_account''][''value''];\r\n		$chinabank_key = $payment_arr[''chinabank_key''][''value''];\r\n        \r\n        $data_vid           = trim($chinabank_account);\r\n        $data_orderid       = $order[''log_id''];\r\n        $data_vamount       = $order[''total''];\r\n        $data_vmoneytype    = ''CNY'';\r\n        $data_vpaykey       = trim($chinabank_key);\r\n        $data_vreturnurl    = "http://".$host.$db->webroot."/responds/index/chinabank";\r\n        if (empty($order[''log_id'']))\r\n        {\r\n            $remark1    = "voucher";                      //商户需要在支付结果通知中转发的商户参数二\r\n        }\r\n        else\r\n        {\r\n            $remark1    = '''';\r\n        }\r\n\r\n        $MD5KEY =$data_vamount.$data_vmoneytype.$data_orderid.$data_vid.$data_vreturnurl.$data_vpaykey;\r\n        $MD5KEY = strtoupper(md5($MD5KEY));\r\n\r\n        $def_url  = ''<br /><form style="text-align:center;" method=post action="https://pay3.chinabank.com.cn/PayGate" target="_blank">'';\r\n        $def_url .= "<input type=HIDDEN name=''v_mid'' value=''".$data_vid."''>";\r\n        $def_url .= "<input type=HIDDEN name=''v_oid'' value=''".$data_orderid."''>";\r\n        $def_url .= "<input type=HIDDEN name=''v_amount'' value=''".$data_vamount."''>";\r\n        $def_url .= "<input type=HIDDEN name=''v_moneytype''  value=''".$data_vmoneytype."''>";\r\n        $def_url .= "<input type=HIDDEN name=''v_url''  value=''".$data_vreturnurl."''>";\r\n        $def_url .= "<input type=HIDDEN name=''v_md5info'' value=''".$MD5KEY."''>";\r\n        $def_url .= "<input type=HIDDEN name=''remark1'' value=''".$remark1."''>";\r\n        $def_url .= "<input type=submit value=''" ."立即使用网银支付". "''>";\r\n        $def_url .= "</form>";\r\n\r\n        return $def_url;\r\n    }\r\n\r\n    /**\r\n     * 响应操作\r\n     */\r\n    function respond($db)\r\n    {\r\n		$payment = $db->Payment->findbycode(''chinabank'');\r\n        eval($payment[''Payment''][''config'']);    \r\n		$chinabank_key = $payment_arr[''chinabank_key''][''value''];\r\n		$chinabank_account = $payment_arr[''chinabank_account''][''value''];\r\n		\r\n        $v_oid          = trim($_POST[''v_oid'']);\r\n        $v_pmode        = trim($_POST[''v_pmode'']);\r\n        $v_pstatus      = trim($_POST[''v_pstatus'']);\r\n        $v_pstring      = trim($_POST[''v_pstring'']);\r\n        $v_amount       = trim($_POST[''v_amount'']);\r\n        $v_moneytype    = trim($_POST[''v_moneytype'']);\r\n        $remark1        = trim($_POST[''remark1'' ]);\r\n        $remark2        = trim($_POST[''remark2'' ]);\r\n        $v_md5str       = trim($_POST[''v_md5str'' ]);\r\n\r\n        /**\r\n         * 重新计算md5的值\r\n         */\r\n        $key            = $chinabank_key;\r\n        $payment_log = $db->PaymentApiLog->findbyid($v_oid);\r\n        $md5string=strtoupper(md5($v_oid.$v_pstatus.$v_amount.$v_moneytype.$key));\r\n\r\n        if ($v_md5str==$md5string)\r\n        {\r\n            /*\r\n            if ($remark1 == ''voucher'')\r\n            {\r\n           		$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n		        if ($total_fee != $account[''UserAccount''][''amount''])\r\n		        {\r\n		            return false;\r\n		        }\r\n            }\r\n            else\r\n            {\r\n                $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n		        if ($total_fee != $order_total[''Order''][''total''])\r\n		        {\r\n		            return false;\r\n		        }\r\n            }*/\r\n			if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n				$account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n		        if ($v_amount != $account[''UserAccount''][''amount''])\r\n		        {\r\n		            return false;\r\n		        }\r\n			}else{\r\n                $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n		        if ($v_amount != $order_total[''Order''][''total''])\r\n		        {\r\n		            return false;\r\n		        }			\r\n			}\r\n\r\n            if ($v_pstatus == ''20'')\r\n            {\r\n            	if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n				/* 充值成功*/\r\n			$db->update_balance($payment_log,$order_total);      \r\n				   return true;\r\n            	}else{\r\n		            /* 改变订单状态 */\r\n			$db->update_order($payment_log,$order_total);       \r\n					 return true;\r\n				}\r\n            }\r\n        }\r\n        else\r\n        {\r\n            return false;\r\n        }\r\n    }\r\n}', '', '2008-01-01 00:00:00', '2015-03-25 10:08:19');
