' name=''productName'' value=''" . $product_name . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''payType'' value=''" . $pay_type . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''productNum'' value=''" . $product_num . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''productId'' value=''" . $product_id . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''productDesc'' value=''" . $product_desc . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''ext1'' value=''" . $ext1 . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''ext2'' value=''" . $ext2 . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''bankId'' value=''" . $bank_id . "'' />";\r\n        $def_url .= "<input type=''hidden'' name=''redoFlag'' value=''" . $redo_flag ."'' />";\r\n        $def_url .= "<input type=''hidden'' name=''pid'' value=''" . $pid . "'' />";\r\n        $def_url .= "<input type=''submit'' name=''submit'' value=''" . "立即使用快钱支付" . "'' />";\r\n        $def_url .= "</form></div></br>";\r\n\r\n        return $def_url;\r\n    }\r\n\r\n    /**\r\n     * 响应操作\r\n     */\r\n 	function respond($db)\r\n    {\r\n    	\r\n        $payment = $db->Payment->findbycode(''kuaiqian'');\r\n        eval($payment[''Payment''][''config'']);    \r\n		$merchant_acctid = $payment_arr[''kq_account''][''value''];\r\n		$key = $payment_arr[''kq_key''][''value''];\r\n        $get_merchant_acctid = trim($_REQUEST[''merchantAcctId'']);\r\n        $pay_result          = trim($_REQUEST[''payResult'']);\r\n        $version             = trim($_REQUEST[''version'']);\r\n        $language            = trim($_REQUEST[''language'']);\r\n        $sign_type           = trim($_REQUEST[''signType'']);\r\n        $pay_type            = trim($_REQUEST[''payType'']);\r\n        $bank_id             = trim($_REQUEST[''bankId'']);\r\n        $order_id            = trim($_REQUEST[''orderId'']);\r\n        $order_time          = trim($_REQUEST[''orderTime'']);\r\n        $order_amount        = trim($_REQUEST[''orderAmount'']);\r\n        $deal_id             = trim($_REQUEST[''dealId'']);\r\n        $bank_deal_id        = trim($_REQUEST[''bankDealId'']);\r\n        $deal_time           = trim($_REQUEST[''dealTime'']);\r\n        $pay_amount          = trim($_REQUEST[''payAmount'']);\r\n        $fee                 = trim($_REQUEST[''fee'']);\r\n        $ext1                = trim($_REQUEST[''ext1'']);\r\n        $ext2                = trim($_REQUEST[''ext2'']);\r\n        $err_code            = trim($_REQUEST[''errCode'']);\r\n        $sign_msg            = trim($_REQUEST[''signMsg'']);\r\n\r\n        //生成加密串。必须保持如下顺序。\r\n        $merchant_signmsgval = '''';\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"merchantAcctId",$merchant_acctid);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"version",$version);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"language",$language);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"signType",$sign_type);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"payType",$pay_type);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"bankId",$bank_id);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"orderId",$order_id);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"orderTime",$order_time);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"orderAmount",$order_amount);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"dealId",$deal_id);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"bankDealId",$bank_deal_id);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"dealTime",$deal_time);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"payAmount",$pay_amount);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"fee",$fee);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"ext1",$ext1);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"ext2",$ext2);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"payResult",$pay_result);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"errCode",$err_code);\r\n        $merchant_signmsgval = $this->append_param($merchant_signmsgval,"key",$key);\r\n        $merchant_signmsg    = md5($merchant_signmsgval);\r\n\r\n        //首先对获得的商户号进行比对\r\n        if ($get_merchant_acctid != $merchant_acctid)\r\n        {\r\n            //商户号错误\r\n            return false;\r\n        }\r\n\r\n        if (strtoupper($sign_msg) == strtoupper($merchant_signmsg))\r\n        {\r\n            if ($pay_result == 10 || $pay_result == 00)\r\n            {\r\n       		$payment_log = $db->PaymentApiLog->findbyid($order_id);\r\n			if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n			   $account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n			/* 充值成功*/\r\n				$db->update_balance($payment_log,$account);       \r\n			   return true;       		\r\n       		\r\n       		}else{\r\n	       		$order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	            /* 改变订单状态 */     \r\n				$db->update_order($payment_log,$order_total);        			           \r\n			 		return true;\r\n            	}\r\n            }else{\r\n                //''支付结果失败'';\r\n                return false;\r\n            }\r\n        }\r\n        else\r\n        {\r\n            //''密钥校对错误'';\r\n            return false;\r\n        }\r\n    }\r\n\r\n    /**\r\n    * 将变量值不为空的参数组成字符串\r\n    * @param   string   $strs  参数字符串\r\n    * @param   string   $key   参数键名\r\n    * @param   string   $val   参数键对应值\r\n    */\r\n    function append_param($strs,$key,$val)\r\n    {\r\n        if($strs != "")\r\n        {\r\n            if($key != '''' && $val != '''')\r\n            {\r\n                $strs .= ''&'' . $key . ''='' . $val;\r\n            }\r\n        }\r\n        else\r\n        {\r\n            if($val != '''')\r\n            {\r\n                $strs = $key . ''='' . $val;\r\n            }\r\n        }\r\n            return $strs;\r\n    }\r\n    function local_date($format,$db,$time = NULL)\r\n	{\r\n	    $timezone = $db->locale[''default_timezone'']*(-1);\r\n\r\n	    if ($time === NULL)\r\n	    {\r\n	        $time = gmtime();\r\n	    }\r\n	    elseif ($time <= 0)\r\n	    {\r\n	        return '''';\r\n	    }\r\n\r\n	    $time += ($timezone * 3600);\r\n\r\n	    return date($format, $time);\r\n	}\r\n\r\n}', '', '2008-01-01 00:00:00', '2015-05-11 10:23:38'),
(17, 23, 0, 'AuthorizeNet_AIM', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class AuthorizeNet_AIM\r\n{\r\n    function AuthorizeNet_AIM()\r\n    {\r\n    }\r\n    function __construct()\r\n    {\r\n        $this->AuthorizeNet_AIM();\r\n    }\r\n    function get_code($order, $payment,$db)\r\n    {\r\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n		$payment_log = $db->PaymentApiLog->findbyid($order[''log_id'']);\r\n		$order_info = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n		$order_info = $order_info[''Order''];\r\n		$sequence = rand(1, 1000);\r\n		eval($payment[''Payment''][''config'']);\r\n		$module_params["param01"] = $payment_arr[''param01''][''value''];		\r\n		$module_params["param02"] = $payment_arr[''param02''][''value''];			\r\n		$module_params["param03"] = "";	\r\n		$module_params["param04"] = "";\r\n		$module_params["param05"] = $payment_arr[''param05''][''value''];		\r\n		$module_params["param06"] = "";\r\n		\r\n		\r\n		$secure_oid = $order[''log_id''];\r\n		$loginid = $module_params["param01"];\r\n		$txnkey = $module_params["param02"];\r\n		$_orderids = $secure_oid;\r\n		$currencycode = $module_params["param05"];\r\n		$amount = $order[''total''];\r\n		$tstamp = (time()-(int)$module_params["param06"]*3600);\r\n		$fingerprint = $this->hmac($txnkey, $loginid . "^".$sequence."^".$tstamp."^".$amount."^".$currencycode);\r\n		$description = $db->configs[''shop_name'']."-".$order[''log_id''];\r\n    $submit_data = array(\r\n                         ''x_login'' => trim($loginid),\r\n                         ''x_tran_key'' => trim($txnkey),\r\n                         ''x_relay_response'' => ''FALSE'', // AIM uses direct response, not relay response\r\n                         ''x_delim_data'' => ''TRUE'',\r\n                         ''x_delim_char'' => ''*'',  // The default delimiter is a comma\r\n                         ''x_encap_char'' => ''|'',  // The divider to encapsulate response fields\r\n                         ''x_version'' => ''3.1'',  // 3.1 is required to use CVV codes\r\n                         ''x_type'' =>  ''AUTH_ONLY'',\r\n                         ''x_method'' => ''CC'',\r\n                         ''x_amount'' => number_format($order[''total''], 2),\r\n                         ''x_currency_code'' => $currencycode,\r\n                         ''x_card_num'' => '''',\r\n                         ''x_exp_date'' => '''',\r\n                         ''x_card_code'' => '''',\r\n                         ''x_email_customer'' => ''TRUE'',\r\n                         ''x_email_merchant'' => ''TRUE'',\r\n                         ''x_cust_id'' =>$order_info["user_id"],\r\n                         ''x_invoice_num'' => '''' . $order_info["id"],\r\n                         ''x_first_name'' => $order_info["user_id"],\r\n                         ''x_last_name'' => $order_info["user_id"],\r\n                         ''x_company'' => '''',\r\n                         ''x_address'' => $order_info[''address''],\r\n                         ''x_city'' => $order_info[''regions''],\r\n                         ''x_state'' => '''',\r\n                         ''x_zip'' => $order_info[''zipcode''],\r\n                         ''x_country'' => $order_info[''regions''],\r\n                         ''x_phone'' => $order_info[''telephone''],\r\n                         ''x_email'' => $order_info[''email''],\r\n                         ''x_ship_to_first_name'' => $order_info["user_id"],\r\n                         ''x_ship_to_last_name'' => $order_info["user_id"],\r\n                         ''x_ship_to_address'' => $order_info[''address''],\r\n                         ''x_ship_to_city'' => $order_info[''regions''],\r\n                         ''x_ship_to_state'' => '''',\r\n                         ''x_ship_to_zip'' => $order_info[''zipcode''],\r\n                         ''x_ship_to_country'' => $order_info[''regions''],\r\n                         ''x_description'' => $description,\r\n                         ''x_recurring_billing'' => ''NO'',\r\n                         ''x_customer_ip'' => '''',\r\n                         ''x_po_num'' => date(''M-d-Y h:i:s''), //$order->info[''po_number''],\r\n                         ''x_freight'' => number_format(0,2),\r\n                         ''x_tax_exempt'' => ''FALSE'', /* ''TRUE'' or ''FALSE'' */\r\n                         ''x_tax'' => number_format(0,2),\r\n                         ''x_duty'' => ''0'',\r\n\r\n                         // Additional Merchant-defined variables go here\r\n                         ''Date'' => $order_info[''created''],\r\n                         ''IP'' => '''',\r\n                         ''Session'' => session_id() );\r\n                         \r\n                        $response = $this->_sendRequest($submit_data,$loginid,$txnkey);\r\n                        \r\n                        $this->zen_redirect($this->zen_href_link(''checkout_payment'', '''', ''SSL'', true, false));\r\n                        \r\n    } \r\n    \r\n    	function hmac ($key, $data) {\r\n		$b = 64; // byte length for md5\r\n		if (strlen($key) > $b)\r\n			$key = pack("H*",md5($key));\r\n		$key  = str_pad($key, $b, chr(0x00));\r\n		$ipad = str_pad('''', $b, chr(0x36));\r\n		$opad = str_pad('''', $b, chr(0x5c));\r\n		$k_ipad = $key ^ $ipad ;\r\n		$k_opad = $key ^ $opad;\r\n\r\n		return md5($k_opad . pack("H*",md5($k_ipad . $data)));\r\n	}\r\n               \r\n    function respond($db)\r\n    {\r\n	    $proceedToVoid = true;\r\n	    if (isset($_POST[''ordervoid'']) && $_POST[''ordervoid''] == "Do Void") {\r\n	    	if (isset($_POST[''voidconfirm'']) && $_POST[''voidconfirm''] != ''on'') {\r\n	 		   $proceedToVoid = false;\r\n	    	}\r\n	    }\r\n    	if ($proceedToVoid){\r\n       			$payment_log = $db->PaymentApiLog->findbyid($_POST[''ordervoid'']);\r\n		        $order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n			    /* 改变订单状态 */\r\n			if($payment_log[''PaymentApiLog''][''type''] > 0){\r\n			   $account = $db->UserAccount->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n			/* 充值成功*/\r\n				$db->update_balance($payment_log,$order_total);       \r\n       		}else{\r\n	       		$order_total = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\r\n	            /* 改变订单状态 */\r\n				$db->update_order($payment_log,$order_total);        			           \r\n            }  			           \r\n	  		return true;\r\n  		}else{\r\n  			return false;\r\n  		}\r\n  		\r\n    }                 \r\n  function _sendRequest($submit_data,$loginid,$txnkey) {\r\n\r\n    // Populate an array that contains all of the data to be sent to Authorize.net\r\n    $submit_data = array_merge(array(\r\n                         ''x_login'' => trim($loginid),\r\n                         ''x_tran_key'' => trim($txnkey),\r\n                         ''x_relay_response'' => ''FALSE'',\r\n                         ''x_delim_data'' => ''TRUE'',\r\n                         ''x_delim_char'' => ''*'',  // The default delimiter is a comma\r\n                         ''x_encap_char'' => ''|'',  // The divider to encapsulate response fields\r\n                         ''x_version'' => ''3.1'',  // 3.1 is required to use CVV codes\r\n                         ), $submit_data);\r\n\r\n    // set URL\r\n    $url = ''https://secure.authorize.net/gateway/transact.dll'';\r\n    $data = '''';\r\n    while(list($key, $value) = each($submit_data)) {\r\n      if ($key != ''x_delim_char'' && $key != ''x_encap_char'') {\r\n        $value = str_replace(array(''|'', ''*'',''"'',"''",''&amp;'',''&'', ''=''), '''', $value);\r\n      }\r\n      $data .= $key . ''='' . urlencode($value) . ''&'';\r\n    }\r\n    // Remove the last "&" from the string\r\n    $data = substr($data, 0, -1);\r\n    // Send CURL communication\r\n    $ch = curl_init();\r\n    curl_setopt($ch, CURLOPT_URL, $url);\r\n    curl_setopt($ch, CURLOPT_VERBOSE, 0);\r\n    curl_setopt($ch, CURLOPT_POST, 1);\r\n    curl_setopt($ch, CURLOPT_POSTFIELDS, $data);\r\n    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);\r\n    curl_setopt($ch, CURLOPT_TIMEOUT, 15);\r\n    curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, FALSE); /* compatibility for SSL communications on some Windows servers (IIS 5.0+) */\r\n    if (''False'' == ''True'') {\r\n      $proxy_tunnel_flag = (defined(''CURL_PROXY_TUNNEL_FLAG'') && strtoupper(CURL_PROXY_TUNNEL_FLAG) == ''FALSE'') ? false : true;\r\n      curl_setopt ($ch, CURLOPT_HTTPPROXYTUNNEL, $this->proxy_tunnel_flag);\r\n      curl_setopt ($ch, CURLOPT_PROXYTYPE, CURLPROXY_HTTP);\r\n      curl_setopt ($ch, CURLOPT_PROXY, CURL_PROXY_SERVER_DETAILS);\r\n    }\r\n\r\n    $authorize = curl_exec($ch);\r\n    $commError = curl_exec($ch);\r\n    $commErrNo = curl_exec($ch);\r\n\r\n    $commInfo = curl_getinfo($ch);\r\n    curl_close ($ch);\r\n\r\n    // parse the data received back from the gateway, taking into account the delimiters and encapsulation characters\r\n    $stringToParse = $authorize;\r\n    if (substr($stringToParse,0,1) == ''*'') $stringToParse = substr($stringToParse,1);\r\n    $stringToParse = preg_replace(''/.{*}'' . ''*'' . ''$/'', '''', $stringToParse);\r\n    $response = explode(''*'' . ''|'' . ''*'', $stringToParse);\r\n\r\n    return $response;\r\n  }               \r\n	\r\n  function zen_href_link($page = '''', $parameters = '''', $connection = ''NONSSL'', $add_session_id = true, $search_engine_safe = true, $static = false, $use_dir_ws_catalog = true) {\r\n		\r\n		$sefu = explode(",", ereg_replace( '' +'', '''', '''' ));\r\n		return $this->original_zen_href_link($page, $parameters, $connection, $add_session_id, $search_engine_safe, $static, $use_dir_ws_catalog);\r\n\r\n  }\r\n  \r\n  function original_zen_href_link($page = '''', $parameters = '''', $connection = ''NONSSL'', $add_session_id = true, $search_engine_safe = true, $static = false, $use_dir_ws_catalog = true) {\r\n    global $request_type, $session_started, $http_domain, $https_domain;\r\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n    if ($connection == ''NONSSL'') {\r\n      $link = $host;\r\n    } elseif ($connection == ''SSL'') {\r\n      if (''false'' == ''true'') {\r\n        $link = $host ;\r\n      } else {\r\n        $link = $host;\r\n      }\r\n    } else {\r\n      die(''</td></tr></table></td></tr></table><br /><br /><strong class="note">Error!<br /><br />Unable to determine connection method on a link!<br /><br />Known methods: NONSSL SSL</strong><br /><br />'');\r\n    }\r\n\r\n    if ($use_dir_ws_catalog) {\r\n      if ($connection == ''SSL'' && ''false'' == ''true'') {\r\n        $link .= ''/'';\r\n      } else {\r\n        $link .= ''/'';\r\n      }\r\n    }\r\n\r\n    if (!$static) {\r\n      if ($this->zen_not_null($parameters)) {\r\n        $link .= ''index.php?main_page=''. $page . "&" . $this->zen_output_string($parameters);\r\n      } else {\r\n        $link .= ''index.php?main_page='' . $page;\r\n      }\r\n    } else {\r\n      if ($this->zen_not_null($parameters)) {\r\n        $link .= $page . "?" . $this->zen_output_string($parameters);\r\n      } else {\r\n        $link .= $page;\r\n      }\r\n    }\r\n\r\n    $separator = ''&'';\r\n\r\n    while ( (substr($link, -1) == ''&'') || (substr($link, -1) == ''?'') ) $link = substr($link, 0, -1);\r\n\r\n    $sid = session_id() . ''='' . session_id();\r\n// clean up the link before processing\r\n    while (strstr($link, ''&&'')) $link = str_replace(''&&'', ''&'', $link);\r\n    while (strstr($link, ''&amp;&amp;'')) $link = str_replace(''&amp;&amp;'', ''&amp;'', $link);\r\n\r\n    if ( (''false'' == ''true'') && ($search_engine_safe == true) ) {\r\n      while (strstr($link, ''&&'')) $link = str_replace(''&&'', ''&'', $link);\r\n\r\n      $link = str_replace(''&amp;'', ''/'', $link);\r\n      $link = str_replace(''?'', ''/'', $link);\r\n      $link = str_replace(''&'', ''/'', $link);\r\n      $link = str_replace(''='', ''/'', $link);\r\n\r\n      $separator = ''?'';\r\n    }\r\n\r\n    if (isset($sid)) {\r\n      $link .= $separator . $this->zen_output_string($sid);\r\n    }\r\n\r\n// clean up the link after processing\r\n    while (strstr($link, ''&amp;&amp;'')) $link = str_replace(''&amp;&amp;'', ''&amp;'', $link);\r\n\r\n    $link = ereg_replace(''&'', ''&amp;'', $link);\r\n    return $link;\r\n  }  \r\n    function zen_output_string($string, $translate = false, $protected = false) {\r\n    if ($protected == true) {\r\n      return htmlspecialchars($string);\r\n    } else {\r\n      if ($translate == false) {\r\n        return $this->zen_parse_input_field_data($string, array(''"'' => ''&quot;''));\r\n      } else {\r\n        return $this->zen_parse_input_field_data($string, $translate);\r\n      }\r\n    }\r\n  }\r\n    function zen_parse_input_field_data($data, $parse) {\r\n    return strtr(trim($data), $parse);\r\n  }	\r\n  \r\n  function zen_redirect($url) {\r\n	$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\r\n    global $request_type;\r\n    // Are we loading an SSL page?\r\n    if ( (''false'' == true) && ($request_type == ''SSL'') ) {\r\n      // yes, but a NONSSL url was supplied\r\n      if (substr($url, 0, strlen($host . ''/'')) == $host  . ''/'') {\r\n        // So, change it to SSL, based on site''s configuration for SSL\r\n        $url = $host  . ''/'' . substr($url, strlen($host  . ''/''));\r\n      }\r\n    }\r\n\r\n  // clean up URL before executing it\r\n    while (strstr($url, ''&&'')) $url = str_replace(''&&'', ''&'', $url);\r\n    while (strstr($url, ''&amp;&amp;'')) $url = str_replace(''&amp;&amp;'', ''&amp;'', $url);\r\n    // header locates should not have the &amp; in the address it breaks things\r\n    while (strstr($url, ''&amp;'')) $url = str_replace(''&amp;'', ''&'', $url);\r\n\r\n    header(''Location: '' . $url);\r\n  }  \r\n  function zen_not_null($value) {\r\n    if (is_array($value)) {\r\n      if (sizeof($value) > 0) {\r\n        return true;\r\n      } else {\r\n        return false;\r\n      }\r\n    } elseif( is_a( $value, ''queryFactoryResult'' ) ) {\r\n      if (sizeof($value->result) > 0) {\r\n        return true;\r\n      } else {\r\n        return false;\r\n      }\r\n    } else {\r\n      if ( (is_string($value) || is_int($value)) && ($value != '''') && ($value != ''NULL'') && (strlen(trim($value)) > 0)) {\r\n        return true;\r\n      } else {\r\n        return false;\r\n      }\r\n    }\r\n  }\r\n\r\n\r\n} ', 'cc', '2008-01-01 00:00:00', '2015-03-25 10:24:22'),
