(16, 23, 0, 'AuthorizeNet_SIM', '0', 0, NULL, '0', NULL, '0', 0, '1', '1', '1', 'class AuthorizeNet_SIM\n{\n    function AuthorizeNet_SIM()\n    {\n    }\n    function __construct()\n    {\n        $this->AuthorizeNet_SIM();\n    }\n    function get_code($order, $payment,$db)\n    {\n		$host = isset($_SERVER[''HTTP_X_FORWARDED_HOST'']) ? $_SERVER[''HTTP_X_FORWARDED_HOST''] : (isset($_SERVER[''HTTP_HOST'']) ? $_SERVER[''HTTP_HOST''] : '''');\n		$payment_log = $db->PaymentApiLog->findbyid($order[''log_id'']);\n		$order_info = $db->Order->findbyid($payment_log[''PaymentApiLog''][''type_id'']);\n		$order_info = $order_info[''Order''];\n		$sequence = rand(1, 1000);\n		eval($payment[''Payment''][''config'']);\n		$module_params["param01"] = $payment_arr[''param01''][''value''];		\n		$module_params["param02"] = $payment_arr[''param02''][''value''];			\n		$module_params["param03"] = "";	\n		$module_params["param04"] = "";\n		$module_params["param05"] = $payment_arr[''param05''][''value''];		\n		$module_params["param06"] = "";\n		\n		\n		$secure_oid = $order[''log_id''];\n		$loginid = $module_params["param01"];\n		$txnkey = $module_params["param02"];\n		$_orderids = $secure_oid;\n		$currencycode = $module_params["param05"];\n		$amount = $order[''total''];\n		$tstamp = (time()-(int)$module_params["param06"]*3600);\n		$fingerprint = $this->hmac($txnkey, $loginid . "^".$sequence."^".$tstamp."^".$amount."^".$currencycode);\n\n	    $def_url  = ''<br /><form style="text-align:center;" action="https://secure.authorize.net/gateway/transact.dll" method="post" target="_blank">'' .   // 不能省略\n            "<p class=''back_home''>".\n			"<input type=''hidden'' name=''x_fp_sequence'' value=''".$sequence."''>".\n			"<input type=''hidden'' name=''x_fp_timestamp'' value=''".$tstamp."''>".\n			"<input type=''hidden'' name=''x_fp_hash'' value=''".$fingerprint."''>".\n			"<input type=''hidden'' name=''x_Show_Form'' value=''PAYMENT_FORM''>".\n			"<input type=''hidden'' name=''x_Test_Request'' value=''FALSE''>".//$module_params["testmode"] == "N" ? \n			"<input type=''hidden'' name=''x_Login'' value=''".$loginid."''>".\n			"<input type=''hidden'' name=''''x_Amount'' value=''".$amount.">".\n			"<input type=''hidden'' name=''x_Currency_Code'' value=''".$currencycode."''>".\n			"<input type=''hidden'' name=''x_Card_Num'' value=''''>".//htmlspecialchars($userinfo["card_number"])\n			"<input type=''hidden'' name=''x_Exp_Date'' value=''''>".//htmlspecialchars($userinfo["card_expire"])\n			"<input type=''hidden'' name=''x_Method'' value=''CC''>".\n			"<input type=''hidden'' name=''x_Type'' value=''AUTH_CAPTURE''>".\n			"<input type=''hidden'' name=''x_First_Name'' value=''".$order_info["user_id"]."''>".\n			"<input type=''hidden'' name=''x_Last_Name'' value=''".$order_info["user_id"]."''>".\n			"<input type=''hidden'' name=''x_Phone'' value=''".$order_info["telephone"]."''>".\n			"<input type=''hidden'' name=''x_Company'' value=''''>". //htmlspecialchars($order_info["company"])\n			"<input type=''hidden'' name=''x_Email'' value=''".$order_info["email"]."''>".\n			"<input type=''hidden'' name=''x_Cust_ID'' value=''".$order_info["id"]."''>".\n			"<input type=''hidden'' name=''x_Address'' value=''".$order_info["address"]."''>".\n			"<input type=''hidden'' name=''x_City'' value=''".$order_info["regions"]."''>".\n			"<input type=''hidden'' name=''x_State'' value=''n/a''>".//$userinfo["b_state"]?$userinfo["b_state"]:\n			"<input type=''hidden'' name=''x_Zip'' value=''".$order_info["zipcode"]."''>".\n			"<input type=''hidden'' name=''x_Country'' value=''".$order_info["regions"]."''>".\n			"<input type=''hidden'' name=''x_ship_to_First_Name'' value=''".$order_info["user_id"]."''>".//$userinfo["s_firstname"]\n			"<input type=''hidden'' name=''x_ship_to_Last_Name'' value=''".$order_info["user_id"]."''>".//$userinfo["s_lastname"]\n			"<input type=''hidden'' name=''x_ship_to_Address'' value=''".$order_info["address"]."''>".\n			"<input type=''hidden'' name=''x_ship_to_City'' value=''".$order_info["regions"]."''>".\n			"<input type=''hidden'' name=''x_ship_to_State'' value=''n/a''>".//$userinfo["s_state"]?$userinfo["s_state"]:\n			"<input type=''hidden'' name=''x_ship_to_Zip'' value=''".$order_info["zipcode"]."''>".\n			"<input type=''hidden'' name=x_ship_to_Country'' value=''".$order_info["regions"]."''>".\n			"<input type=''hidden'' name=''x_Invoice_num'' value=''".$order[''log_id'']."''>".\n			"<input TYPE=''HIDDEN'' NAME=''x_Relay_Response'' VALUE=''True''>".\n			"<input TYPE=''HIDDEN'' NAME=''x_Relay_URL'' VALUE=''"."http://".$host.$db->webroot."/responds/index/AuthorizeNet_SIM"."''>".\n            "<input type=''submit'' value=''authorize-SIM''>" .                      // 按钮\n            "</p>".\n			"</form><br />";\n        return $def_url;\n    } \n    \n    	function hmac ($key, $data) {\n		$b = 64; // byte length for md5\n		if (strlen($key) > $b)\n			$key = pack("H*",md5($key));\n		$key  = str_pad($key, $b, chr(0x00));\n		$ipad = str_pad('''', $b, chr(0x36));\n		$opad = str_pad('''', $b, chr(0x5c));\n		$k_ipad = $key ^ $ipad ;\n		$k_opad = $key ^ $opad;\n\n		return md5($k_opad . pack("H*",md5($k_ipad . $data)));\n	}\n               \n}           ', '', '2008-01-01 00:00:00', '2015-03-25 10:24:00'),
