(3838, 'jpn', 27, 'SEO优化', '', 'SEO优化', ' SEO是网站营销推广的一个方面，它是针对搜索引擎的优化与推广。\r\n主要是针对搜索引擎去使网站内容较容易被搜索引擎取得并接受，搜索引擎在收到该网站的资料后进行比对及运算后将最适合搜索引擎排名规律的网站放在网络的前面，使搜索者在搜索时候看到，进行使搜索者更容易搜索到自己查找的内容。SEO在信息时代是非常有用，在网店SEO的作用是显而易见的。\r\n', '约客网', '2012-07-05 13:50:56', '2012-07-05 13:50:56'),
(2704, 'eng', 30, 'Photo album templates', '月', '相册模板', ' 相册模板是产品图片的各种特效的展现方式。比如放大镜、产品缩略图等。', '约客网', '2011-12-05 16:03:24', '2011-12-05 16:03:24'),
(2705, 'cht', 30, '相册模板', '月', '相册模板', ' 相册模板是产品图片的各种特效的展现方式。比如放大镜、产品缩略图等。', '约客网', '2011-12-05 16:03:24', '2011-12-05 16:03:24'),
(4325, 'cht', 34, '交易', '月', '', '购物车是对现实的购物车而喻，买家可以像在超市里购物一样，随意添加、删除商品，选购完毕后，统一下单。网上商店的购物车能跟踪顾客所选的的商品，记录下所选商品，能随时更新，可以支付购买，能给顾客提供很大的方便。', ' ', '2013-08-06 11:41:36', '2013-08-06 11:41:36'),
