(3801, 'cht', 41, '绑定顶级域名', '', '', '域名就相当于互联网上一个仓库的门牌号码，并且它是全球唯一的。一般的网店会自动生成一个二级域名，网址不容易记住。但顶级域名是可以根据您自己的要求去申请的，您可以申请后简单易记的顶级域名绑定到网店上。一个好的域名可以让网店增值数倍。\r\n绑定顶级域名，无需登记备案！', ' ', '2012-07-05 13:42:15', '2012-07-05 13:42:15'),
