(3836, 'eng', 27, 'SEO optimization', '', 'SEO优化', ' SEO是网站营销推广的一个方面，它是针对搜索引擎的优化与推广。\r\n主要是针对搜索引擎去使网站内容较容易被搜索引擎取得并接受，搜索引擎在收到该网站的资料后进行比对及运算后将最适合搜索引擎排名规律的网站放在网络的前面，使搜索者在搜索时候看到，进行使搜索者更容易搜索到自己查找的内容。SEO在信息时代是非常有用，在网店SEO的作用是显而易见的。\r\n', '约客网', '2012-07-05 13:50:56', '2012-07-05 13:50:56'),
(3802, 'jpn', 41, '绑定顶级域名', '', '绑定顶级域名', '域名就相当于互联网上一个仓库的门牌号码，并且它是全球唯一的。一般的网店会自动生成一个二级域名，网址不容易记住。但顶级域名是可以根据您自己的要求去申请的，您可以申请后简单易记的顶级域名绑定到网店上。一个好的域名可以让网店增值数倍。\r\n绑定顶级域名，无需登记备案！', ' ', '2012-07-05 13:42:15', '2012-07-05 13:42:15'),
(3759, 'chi', 68, '淘宝商品下载', '月', '', '同步商品是针对淘宝B店和C店。可选择同步全部商品或部分商品，宝贝分类、宝贝描述及相册等将自动同步到约客网店。大大节省了添加商品的时间，更提高了效率，是淘宝卖家的一大福音。此应用每次同步200个商品，每天限同步一次。', ' ', '2012-07-05 13:38:38', '2012-07-05 13:38:38'),
