(4282, 'jpn', 8, '评论', '', '评论', '评论对于网店来说很重要，无论是对网店，还是店长本人，都起到关键性作用。网店评论是交易完成的最后一个步骤。网店评价的好坏直接决定信用度的高低，更直接的影响网店交易量的高低。', '约客网', '2013-05-08 17:30:52', '2013-05-08 17:30:52'),
