(2626, 'jpn', 72, '服务器托管', '年', '', '服务器托管是指为了提高网站的访问速度，将您的服务器及相关设备托管到具有完善机房设施、高品质网络环境、丰富带宽资源和运营经验以及可对用户的网络和设备进行实时监控的网络数据中心内，以此使系统达到安全、可靠、稳定、高效运行的目的。用户可以购买服务器设备委托约客网托管。\r\n购买前请先联系客服，先确定周期等。', ' ', '2011-12-05 15:29:06', '2011-12-05 15:29:06'),
(2645, 'cht', 67, '', '月', '', '', ' ', '2011-12-05 15:37:43', '2011-12-05 15:37:43'),
(2646, 'jpn', 67, '网站联盟', '月', '', '网站联盟本质上来说一种按效果付费的网络广告形式，即在自己的网站上投放广告，当访问者产生一定的行为之后（如点击广告、下载程序、注册会员、实现购买等），根据这种行为而获得广告主支付的佣金。网站联盟通过网站赚钱是网站运营的正当模式。为网站支付广告佣金的广告主就是提供网络联盟计划的网站，如yahoo、当当网、卓越网、google adsense 等等，如果这些网站联盟广告适合您的网店，选择知名网站联盟是网站赚钱的首选。', ' ', '2011-12-05 15:37:43', '2011-12-05 15:37:43'),
(3598, 'jpn', 64, '订阅', '月', '订阅', '卖家可以将网店的信息（如上新品、商品促销、专题活动等）做成杂志的形式，统一发送给网店的会员，让会员及时了解网店最新的动态，有效的加强了与买家之间的互动。', ' ', '2012-07-05 11:27:54', '2012-07-05 11:27:54'),
(2665, 'cht', 60, '', '月', '', '', ' ', '2011-12-05 15:43:19', '2011-12-05 15:43:19'),
(2666, 'jpn', 60, '微博同步', '月', '', '微博同步功能也就是为了微博营销。网店的每一个产品都可以同步到新浪、同步到搜狐、同步到腾讯 、同步到开心、同步到人人、同步到百度、同步到豆瓣等。大大的增加了产品的展示机会，直接带来销售额的上升。', ' ', '2011-12-05 15:43:19', '2011-12-05 15:43:19'),
(2681, 'cht', 54, '', '月', '', '', ' ', '2011-12-05 15:48:45', '2011-12-05 15:48:45'),
