(3376, 'eng', 88, 'Copyright removal', '月', '', '', ' ', '2012-06-14 14:51:49', '2012-06-14 14:51:49'),
(3848, 'eng', 18, 'Recharge', '', '充值', ' 充值主要是网店提供的一个增值服务。网店可以设置不同的优惠活动让会员来充值，以达到互惠互利的效果。网店不但赚取了人气还提高了销售率；会员也享受了更多的优惠。', '上海实玮网络科技有限公司', '2012-07-05 13:58:35', '2012-07-05 13:58:35'),
(3849, 'cht', 18, '充值', '', '充值', ' 充值主要是网店提供的一个增值服务。网店可以设置不同的优惠活动让会员来充值，以达到互惠互利的效果。网店不但赚取了人气还提高了销售率；会员也享受了更多的优惠。', '上海实玮网络科技有限公司', '2012-07-05 13:58:35', '2012-07-05 13:58:35'),
(3378, 'jpn', 88, '版权去除工具', '月', '', '前台去版权是指去除约客网店程序前台版权信息（Powered by ioco显示在标题栏和页底）的服务。去除版权后，不会因为系统的升级而恢复原始状态。 注：去版权并非商业授权，去版权是指去除程序产权方在产品上加的版权信息，相当于一个OEM服务。', ' ', '2012-06-14 14:51:49', '2012-06-14 14:51:49'),
