(3550, 'jpn', 1, '积分应用', '月', '', '积分应用可以设置，用户注册赠送多少积分，多少积分等于一元，一个商品赠送多少积分，也可以对用户的积分进行加减等等。', '上海实玮网络科技有限公司', '2012-07-05 11:05:03', '2012-07-05 11:05:03'),
(3784, 'eng', 55, 'Chinese', '', '', '', ' ', '2012-07-05 13:40:49', '2012-07-05 13:40:49'),
(3783, 'chi', 55, '中文', '', '', '网店显示的一种语言。可选择一种，也可以安装多种语言。如果只安装中文，网店就只显示中文；如果再安装英文和日文，网店就有3种语言显示，可以任意切换。', ' ', '2012-07-05 13:40:49', '2012-07-05 13:40:49'),
(3835, 'chi', 27, 'SEO优化', '', 'SEO优化', ' SEO是网站营销推广的一个方面，它是针对搜索引擎的优化与推广。\r\n主要是针对搜索引擎去使网站内容较容易被搜索引擎取得并接受，搜索引擎在收到该网站的资料后进行比对及运算后将最适合搜索引擎排名规律的网站放在网络的前面，使搜索者在搜索时候看到，进行使搜索者更容易搜索到自己查找的内容。SEO在信息时代是非常有用，在网店SEO的作用是显而易见的。\r\n', '约客网', '2012-07-05 13:50:56', '2012-07-05 13:50:56'),
(4326, 'jpn', 34, '交易', '月', '', '购物车是对现实的购物车而喻，买家可以像在超市里购物一样，随意添加、删除商品，选购完毕后，统一下单。网上商店的购物车能跟踪顾客所选的的商品，记录下所选商品，能随时更新，可以支付购买，能给顾客提供很大的方便。', ' ', '2013-08-06 11:41:36', '2013-08-06 11:41:36'),
(3641, 'cht', 127, '商品批发应用', '', '', '安装了此应用后，网店可根据产品购买的数量设置不同的价格。如果买家购买的数量达到了您设置的批发量时，商品价格会自动降低，不需要人工再修改。', ' ', '2012-07-05 11:34:34', '2012-07-05 11:34:34'),
(2603, 'chi', 79, '批发', '月', '', '批发功能。价格会随产品数量的变化而自动产生变化。', ' ', '2011-12-05 15:19:03', '2011-12-05 15:19:03'),
(3799, 'chi', 41, '绑定顶级域名', '', '绑定顶级域名', '域名就相当于互联网上一个仓库的门牌号码，并且它是全球唯一的。一般的网店会自动生成一个二级域名，网址不容易记住。但顶级域名是可以根据您自己的要求去申请的，您可以申请后简单易记的顶级域名绑定到网店上。一个好的域名可以让网店增值数倍。\r\n绑定顶级域名，无需登记备案！', ' ', '2012-07-05 13:42:15', '2012-07-05 13:42:15'),
(2593, 'cht', 84, '', '月', '', '', ' ', '2011-12-05 15:15:08', '2011-12-05 15:15:08'),
(2703, 'chi', 30, '相册模板', '月', '相册模板', '相册模板是产品图片的各种特效的展现方式。比如放大镜、产品缩略图等。', '约客网', '2011-12-05 16:03:24', '2011-12-05 16:03:24'),
(3851, 'chi', 56, '英文', '月', '', '网店显示的一种语言。可选择一种，也可以安装多种语言。如果只安装英文，网店就只显示英文；如果再安装中文和日文，网店就有3种语言显示，可以任意切换。', ' ', '2012-07-05 14:00:00', '2012-07-05 14:00:00'),
