(2643, 'chi', 67, '网站联盟', '月', '', '网站联盟本质上来说一种按效果付费的网络广告形式，即在自己的网站上投放广告，当访问者产生一定的行为之后（如点击广告、下载程序、注册会员、实现购买等），根据这种行为而获得广告主支付的佣金。网站联盟通过网站赚钱是网站运营的正当模式。为网站支付广告佣金的广告主就是提供网络联盟计划的网站，如yahoo、当当网、卓越网、google adsense 等等，如果这些网站联盟广告适合您的网店，选择知名网站联盟是网站赚钱的首选。', ' ', '2011-12-05 15:37:43', '2011-12-05 15:37:43'),
(2663, 'chi', 60, '微博同步', '月', '', '微博同步功能也就是为了微博营销。网店的每一个产品都可以同步到新浪、同步到搜狐、同步到腾讯 、同步到开心、同步到人人、同步到百度、同步到豆瓣等。大大的增加了产品的展示机会，直接带来销售额的上升。', ' ', '2011-12-05 15:43:19', '2011-12-05 15:43:19'),
(2679, 'chi', 54, '统计报表', '月', '', '统计报表主要是针对一些数据，通过分类组合，再形成相应的报表。', ' ', '2011-12-05 15:48:45', '2011-12-05 15:48:45'),
(3847, 'chi', 18, '充值', '', '充值', ' 充值主要是网店提供的一个增值服务。网店可以设置不同的优惠活动让会员来充值，以达到互惠互利的效果。网店不但赚取了人气还提高了销售率；会员也享受了更多的优惠。', '上海实玮网络科技有限公司', '2012-07-05 13:58:35', '2012-07-05 13:58:35'),
(3375, 'chi', 88, '版权去除工具', '月', '', '前台去版权是指去除约客网店程序前台版权信息（Powered by ioco显示在标题栏和页底）的服务。去除版权后，不会因为系统的升级而恢复原始状态。 注：去版权并非商业授权，去版权是指去除程序产权方在产品上加的版权信息，相当于一个OEM服务。', ' ', '2012-06-14 14:51:49', '2012-06-14 14:51:49'),
(3569, 'cht', 21, '在线客服', '', '客服', ' 客户服务是为客户提供服务的窗口，是联系客户与网店的纽带，是传统营业及服务手段的延伸，是网店为客户提供个性化与交互式友好服务的平台，是网店理顺与客户之间的关系并加强客户资源管理和企业经营管理的渠道。能极大的提升客户满意度，进而促进客户忠诚度；也便于将来准确的产品营销。', '约客网', '2012-07-05 11:20:14', '2012-07-05 11:20:14'),
