(2631, 'chi', 71, 'VPS', '月', '', 'VPS（Virtual Private Server 虚拟专用服务器）技术，将一部服务器分割成多个虚拟专享服务器的优质服务。VPS主机非常适合为中小企业、小型门户网站、个人工作室、SOHO一族提供网站空间，较大独享资源，安全可靠的隔离保证了用户对于资源的使用和数据的安全。\r\n3G 内存\r\n30G 硬盘\r\n\r\n购买前请先联系客服，先确定周期等。', ' ', '2011-12-05 15:31:40', '2011-12-05 15:31:40'),
