(3758, 'jpn', 69, '淘宝同步订单', '月', '', '同步订单是针对淘宝B店或C店的淘宝商品下载之后的应用。安装此应用后，在淘宝产生的订单会自动同步到约客网店，方便您统一发货。淘宝店和约客店的订单状态完全保持一致，无需您到多个后台进行管理。', ' ', '2012-07-05 13:38:26', '2012-07-05 13:38:26'),
