(2779, 'chi', 123, '注册顶级域名', '年', '', '约客网提供代理.COM、.NET国际顶级域名注册服务。具体的步骤为：\r\n第一步，用户首先需要注册约客网会员，，然后返回到用户中心》》网店管理，点击注册域名，填好所有信息后，点击“递交”按钮，申请表格就会被约客网客服接收。\r\n第二步，到【增值服务】里购买此服务。一般在48小时之内，用户就会收到约客网回发的电子邮件，并通知递交书面申请，按照要求将书面材料寄给约客网，等候约客网下一步的电子邮件通知。书面材料包括：\r\na.域名注册申请表；\r\nb. 承办人身份证复印件；\r\nc. 营业执照复印件\r\nd.本单位依法登记', ' ', '2011-12-06 11:18:29', '2011-12-06 11:18:29'),
