(3567, 'chi', 21, '在线客服', '', '客服', '客户服务是为客户提供服务的窗口，是联系客户与网店的纽带，是传统营业及服务手段的延伸，是网店为客户提供个性化与交互式友好服务的平台，是网店理顺与客户之间的关系并加强客户资源管理和企业经营管理的渠道。能极大的提升客户满意度，进而促进客户忠诚度；也便于将来准确的产品营销。安装并设置之后，买家可随时在线和卖家交谈。客服设置是网店非常重要的应用之一。若需添加多个QQ号或旺旺号，当中用“分号”隔开，其他的客服号码类似。', '约客网', '2012-07-05 11:20:14', '2012-07-05 11:20:14'),
