(1, 'chi', 37, '$shop_name - 密码找回', NULL, '$user_name 您好！\r\n您已经进行了密码重置的操作，请点击以下链接(或者复制到您的浏览器):\r\n $reset_email\r\n以确认您的新密码重置操作！\r\n$shop_name $shop_url\r\n$send_date ', '$user_name 您好！<br/> 您已经进行了密码重置的操作，请点击以下链接(或者复制到您的浏览器):<br/> <a href=''$reset_email'' target=''_blank''> $reset_email </a> 该链接24小时有效<br/> 以确认您的新密码重置操作！<br/> $shop_name <a href=''$shop_url''>$shop_url</a><br/> $send_date <br/>', '', '2009-03-16 10:23:42', '2009-05-05 17:08:20'),
(2, 'chi', 35, '$shop_name - 订单取消', NULL, '亲爱的 $consignee  ，你好！\r\n您的编号为：$order_code  的订单已取消。\r\n\r\n订单的商品信息:\r\n$products_info\r\n\r\n$shop_name $shop_url\r\n$sent_date', '亲爱的 $consignee  ，你好！<br />\r\n您的编号为：$order_code  的订单已取消。<br />\r\n\r\n订单的商品信息:<br/>\r\n$products_info\r\n\r\n$shop_name <a href=''$shop_url''>$shop_url</a><br/>\r\n$sent_date', '', '2008-01-01 00:00:00', '2009-05-05 17:06:24'),
(3, 'chi', 36, '$shop_name - 订单无效', NULL, '亲爱的 $consignee ，你好！\r\n您的编号为： $order_code 的订单无效。\r\n订单的商品信息:\r\n$products_info\r\n$shop_name $shop_url\r\n$send_date', '亲爱的 $consignee ，你好！<br/>\r\n您的编号为： $order_code 的订单无效。<br />\r\n订单的商品信息:<br/>\r\n$products_info\r\n$shop_name <a href=''$shop_url''>$shop_url</a><br />\r\n$send_date<br />', '', '2008-01-01 00:00:00', '2009-05-05 17:07:27'),
(5, 'chi', 33, '$shop_name - 订单确认邮件', NULL, '亲爱的 $consignee  ，你好！\r\n我们已经收到您于  $formated_add_time  提交的订单。\r\n\r\n订单的商品信息: \r\n$products_info\r\n\r\n\r\n该订单编号为： $order_code  请记住这个编号以便日后的查询。\r\n$shop_name $shop_url\r\n$sent_date', '亲爱的 $consignee  ，你好！<br />\r\n我们已经收到您于  $formated_add_time  提交的订单。<br />\r\n\r\n订单的商品信息: <br />\r\n$products_info\r\n\r\n\r\n该订单编号为： $order_code  请记住这个编号以便日后的查询。 <br />\r\n$shop_name <a href=''$shop_url''>$shop_url</a><br />\r\n$sent_date', '', '2008-01-01 00:00:00', '2009-05-05 17:05:31'),
(6, 'chi', 38, '$shop_name - 发货通知', NULL, '亲爱的 $consignee ， 你好  \r\n我们已经收到您于 $formated_add_time  提交的订单 并且已经发货。\r\n您的配送单号:   $invoice_no\r\n\r\n订单的商品信息: \r\n$products_info\r\n\r\n\r\n该订单编号为： $order_code 请记住这个编号以便日后的查询。\r\n收货确认 $url\r\n$shop_name $shop_url\r\n$send_date ', '亲爱的 $consignee ， 你好  <br />\r\n我们已经收到您于 $formated_add_time  提交的订单 并且已经发货。 <br />\r\n您的配送单号:   $invoice_no <br />\r\n\r\n订单的商品信息: <br />\r\n$products_info\r\n\r\n\r\n该订单编号为： $order_code 请记住这个编号以便日后的查询。<br/>\r\n收货确认 <a href=''$url''>$url</a><br />\r\n$shop_name <a href=''$shop_url''>$shop_url</a><br />\r\n$send_date <br />', '', '2009-03-30 16:53:43', '2009-05-05 17:09:39'),
(7, 'chi', 39, '$shop_name - 虚拟卡片', NULL, '亲爱的$consignee       \r\n你好！您的订单 $order_sn 中$product_name 商品的详细信息如下: \r\n$virtualcards_info\r\n再次感谢您对我们的支持。欢迎您的再次光临。\r\n\r\n$shop_name $shop_url\r\n$send_date ', '亲爱的$consignee       <br />\r\n你好！您的订单 $order_sn 中$product_name 商品的详细信息如下: <br />\r\n$virtualcards_info\r\n再次感谢您对我们的支持。欢迎您的再次光临。 <br />\r\n\r\n$shop_name <a href=''$shop_url''>$shop_url</a><br />\r\n$send_date <br />', '', '2009-04-16 06:15:12', '2009-05-05 17:10:18'),
(144, 'chi', 34, '$shop_name - 通知', '', '', '', '', '2014-09-12 16:33:07', '2014-09-12 16:33:07'),
(9, 'chi', 41, '$shop_name - 留言回复', NULL, '亲爱的 $user_name ，你好！\r\n我们已经收到您于  $created  提交的留言。\r\n留言类型:$msg_type\r\n\r\n留言标题:$msg_title        \r\n\r\n留言内容:$msg_content\r\n\r\n管理员回复:$restore_content\r\n\r\n查看 $url\r\n$shop_name   $shop_url\r\n$sent_date\r\n', '亲爱的 $user_name ，你好！<br/>\r\n我们已经收到您于  $created  提交的留言。<br/>\r\n留言类型:$msg_type <br/>\r\n\r\n留言标题:$msg_title    <br/>   \r\n\r\n留言内容:$msg_content <br/>\r\n\r\n管理员回复:$restore_content <br/>\r\n查看<a href=''url''>$url<a> <br/>\r\n$shop_name   <a href=''$shop_url''>$shop_url<a> <br/>\r\n$sent_date', '', '2009-04-29 18:54:48', '2009-05-05 19:10:58'),
(10, 'chi', 42, '$shop_name - 优惠券邮件', NULL, '', '亲爱的 $user_name 您好！\r\n\r\n恭喜您获得了 1 个优惠券，金额为 $money\r\n\r\n$shop_name $shop_url\r\n$send_date', '', '2009-05-06 13:08:46', '2009-05-06 13:16:32'),
(29, 'chi', 47, '忘记密码', NULL, '$user_name 您好！\r\n我们给你发信是因为收到了你在IOCO上的重置口令请求;\r\n您已经进行了密码重置的操作，请记住您的新密码:\r\n$reset_pwd\r\n$shop_url\r\n', '$user_name 您好！<br/>\r\n我们给你发信是因为收到了你在IOCO上的重置口令请求;<br/>\r\n您已经进行了密码重置的操作，请记住您的新密码:<br/>\r\n$reset_pwd<br/>\r\n <a href=''$shop_url''>$shop_url</a><br />\r\n<br/>\r\n', '', '2009-07-15 23:58:02', '2009-09-30 17:50:23'),
(21, 'chi', 44, '$shop_name - 到货通知', NULL, '亲爱的 $consignee ， 你好  \r\n您所登记商品 $product_name 已到货\r\n点击下面地址查看\r\n$url \r\n$shop_name $shop_url\r\n$send_date ', '亲爱的 $consignee ， 你好  \r\n您所登记商品 $product_name 已到货\r\n点击下面地址查看\r\n$url \r\n$shop_name $shop_url\r\n$send_date ', '', '2009-07-03 02:32:59', '2009-07-03 02:33:06'),
(23, 'chi', 43, '邮件订阅', NULL, '您好~~ <br />\r\n请点击以下链接(或者复制到您的浏览器)来验证你的邮件地址: <br />\r\n$url<br />\r\n$shop_name  <br />\r\n$send_date  <br />', '您好~~ <br />\r\n请点击以下链接(或者复制到您的浏览器)来验证你的邮件地址: <br />\r\n$url<br />\r\n$shop_name  <br />\r\n$send_date  <br />', '', '2009-06-05 17:44:14', '2009-06-05 17:45:14'),
(24, 'chi', 45, '邮件订阅成功', NULL, '管理员~~\r\n$email 订阅成功!\r\n\r\n$shop_name  <br />\r\n$shop_url  <br />\r\n$send_date  <br />', '管理员~~\r\n$email 订阅成功!\r\n\r\n$shop_name  <br />\r\n$shop_url  <br />\r\n$send_date  <br />', '', '2009-06-05 17:50:39', '2009-06-05 17:50:39'),
(42, 'chi', 49, '$shop_name - 订单取消', '', '$user_name 您好!\r\n\\n\r\n这封邮件是爱屋．格林网 发送的。\r\n\\n\r\n您的订单 $order_code 不能取消，\r\n\\n\r\n原因 \r\n\\n\r\n$content\r\n爱屋．格林网 $shop_url\r\n\\n\r\n$send_date', '$user_name 您好!\r\n\\n\r\n这封邮件是爱屋．格林网 发送的。\r\n\\n\r\n您的订单 $order_code 不能取消，\r\n\\n\r\n原因 \r\n\\n\r\n$content\r\n爱屋．格林网 $shop_url\r\n\\n\r\n$send_date', '', '2010-11-29 10:40:00', '2010-11-29 10:43:46'),
