(146, 'chi', 31, '恭喜你加入$shop_name', '', '<p>\r\n	$user_name 您好!  爱屋•格林全体员工诚挚欢迎您的光临！祝您购物愉快！ \\n 您的用户名： $user_name \\n 建议您 保管好本邮件！如忘记密码，请点击<a href="http://www.myevergreen.com.cn/forget_password">找回密码</a>。 \\n 即刻起您可以享受爱屋•格林会员的相 关优惠活动，享受爱屋格林为您带来的温馨时尚的生活方式，为您缔造完美生活！  \\n  爱屋．格林网<a href="http://www.myevergreen.com.cn/"> $shop_url </a>\\n $send_date</p>\r\n', '<p>\r\n	<a href="http://www.myevergreen.com.cn/"><img alt="" src="http://www.myevergreen.com.cn/img/photos/201010//127/1/original/ppxy.gif" /></a></p>\r\n<p>\r\n	$user_name 您好! 爱屋&bull;格林全体员工诚挚欢迎您的光临！祝您购物愉快！</p>\r\n<p>\r\n	您的用户名: $user_name</p>\r\n<p>\r\n	建议您保管好本邮件！如忘记密码，请点击<a href="http://www.myevergreen.com.cn/forget_password">找回密码</a>。</p>\r\n<p>\r\n	即刻起您可以享受爱屋&bull;格林会员的相关优惠活动，享受爱屋格林为您带来的温馨时尚的生活方式，为您缔造完美生活！</p>\r\n<p>\r\n	爱屋．格林网&nbsp;<a href="http://www.myevergreen.com.cn/"> $shop_url </a></p>\r\n<p>\r\n	$send_date</p>\r\n', '', '2014-09-16 13:36:36', '2014-09-16 13:36:36'),
