(20, 0, 'brand_index', 26, 'right', 'module_brand', NULL, 'Brand', 'get_module_infos', '', '.div_brand_index{\r\n  margin-bottom:20px;margin-top:10px;background:#FFFFFF;border:1px solid #CCCCCC;\r\n  box-shadow: 0 1px 3px rgba(34, 25, 25, 0.4);padding: 11px 24px 20px;clear: both; \r\n  overflow: hidden;position: relative;\r\n}\r\n.div_brand_index h4 span{background:#FFFFFF;border-bottom: 1px solid #66CCBB; display: inline-block;\r\nheight: 41px;padding: 0 20px 0 0;color: #333333; margin: 0 5px 0 0;font-size: 18px;font-weight: normal;\r\nline-height: 42px;}\r\n.div_brand_index h4{\r\n  	float:none;height:43px;margin:0 0 16px;font-size:18px;\r\n  	color:#333;padding:0;border:none;line-height:42px;font-weight:normal;\r\n  	background:url(/theme/AmazeUI/img/xian.gif) repeat-x 0 bottom;width:auto}\r\n.div_brand_index .brand_picture {\r\n    border: medium none;\r\n    height: 210px;\r\n    overflow: hidden;\r\n    width: auto;\r\n  	margin: 0 auto;\r\n}\r\n.div_brand_index li {\r\n    margin: 0 15px 12px 0;\r\n  	float: left;\r\n    width: 210px;\r\n}\r\n\r\n.div_brand_index .brand_picture img {\r\n    height: 210px;\r\n    margin: 0 auto;\r\n    width: 210px;\r\n  	display:inline-block;\r\n}', NULL, NULL, '0', 8, 'created', '5', '1', '2014-02-08 16:18:42', '2014-12-18 16:22:31'),
